    private void jButton6ActionPerformed(java.awt.event.ActionEvent evt) {//GEN-FIRST:event_jButton6ActionPerformed
        Garage gdb = AccessDatabase.readGarageDB();
        
        ParkingSession newSpot= new ParkingSession(Integer.parseInt(available.getSelectedItem().toString()),
                licencePlate.getText());
        
        gdb.addCurrentSpot(newSpot);
        
        AccessDatabase.writeGarageDB(gdb);
       
        Garage gdb1 = AccessDatabase.readGarageDB();

        
        available.removeAllItems();
        int [] availableSpots2 = gdb1.getAvailable();
        for(int i = 0; i < availableSpots2.length; i++)
        {
            available.addItem(availableSpots2[i]);
        }
    }//GEN-LAST:event_jButton6ActionPerformed

    private void jButton2ActionPerformed(java.awt.event.ActionEvent evt) {//GEN-FIRST:event_jButton2ActionPerformed
      UserDataBase udb = AccessDatabase.readUserDB();
        Garage gdb = AccessDatabase.readGarageDB();
        
        for(RegisteredUser a : udb.users)
        {
            if(a.username.equals(reservedParkingUser.getText()))
            {
                if(a.getPassword().equals(reservedParkingPassword.getPassword()))
                {
                    for(int i = 0; i<gdb.getReserved().size();i++)
                    {
                        if(reserved.getSelectedItem().toString().equals(gdb.getReserved().get(i).toString()))
                        {
                            String [] info = new String[1];
                            info[0] = gdb.getReserved().get(i).toString();
                           
                            gdb.addCurrentSpot(gdb.getReserved().get(i));
                            gdb.removeReservation(gdb.getReserved().get(i), false);
                            
                            Ticket ticket = new Ticket(info);
                            ticket.setVisible(true);
                        }
                    }
                }
            }
        }
        
        reserved.removeAllItems();
        for(ParkingSession a : gdb.getReserved())
        {
            reserved.addItem(a.toString());
        }
        
    }//GEN-LAST:event_jButton2ActionPerformed

    private void jTabbedPane1MouseClicked(java.awt.event.MouseEvent evt) {//GEN-FIRST:event_jTabbedPane1MouseClicked
        Garage gdb = AccessDatabase.readGarageDB();

        available.removeAllItems();
        int [] availableSpots2 = gdb.getAvailable();
        for(int i = 0; i < availableSpots2.length; i++)
        {
            available.addItem(availableSpots2[i]);
        }

        available1.removeAllItems();
        int [] availableSpots = gdb.getAvailable();
        for(int i = 0; i < availableSpots.length; i++)
        {
            available1.addItem(availableSpots[i]);
        }
        
        reserved.removeAllItems();
        for(ParkingSession a : gdb.getReserved())
        {
            reserved.addItem(a.toString());
        }
    }//GEN-LAST:event_jTabbedPane1MouseClicked

